/**
 * Component to display SVG icons.
 *
 * @component
 *
 * @param {object} props - The component props.
 * @param {string} props.name - The name of the icon.
 * @param {string} [props.className] - Additional class name for styling.
 * @param {object} [props...props] - Any additional props to pass to the underlying SVG element.
 * @returns {JSX.Element} - The rendered Icon component.
 */
const Icon = ({ name, className, ...props }) => {
    const icon = icons[name];

    return (
        <i className={`${className} inline-flex items-center justify-center`} {...props}>
            {icon}
        </i>
    );
};

export default Icon;
